import React from 'react';
import ReactDOM from 'react-dom';
const fname = "Akash";
const lname = "Singh";
var date = new Date();
const imgPath ="https://picsum.photos/seed/picsum/200/300";

ReactDOM.render(<React.Fragment>
  <h1 contentEditable="true"> <b>Favorite Netfix Movie</b>  </h1> 
   <p> Only in english</p>
   <h2> {`My nick name is  ${fname} ${lname}
        and  age is  ${29+5} and date is ${date.toLocaleDateString()} and  time is  ${date.toLocaleTimeString()}`} 
    </h2>
   <ol>
     <li>Dark</li>
     <li>Independance day</li>
     <li>Fast & Furious</li>
     <li>Lap</li>
     <li>cap</li>
     <li>Random number is  {Math.random()} </li>
   </ol>
   <img src={imgPath}/>
</React.Fragment>  , document.getElementById('root'));
